import React from 'react'
import './MiniNote.css'

const MiniNote = (props) => {

  const deleteNote = () => {
    props.deleteIteam(props.id);
  }

  return (
    <>
    <div className='MiniNote_box flex'>
        <div className='Iteams'>
          <h4>{props.title}</h4>
          <p>{props.content}</p>
          <button className='delete' onClick={deleteNote}>
          <i class="fa fa-trash" aria-hidden="true"/>
          </button>
        </div>
      </div>
    </>
  )
}

export default MiniNote
